Футбол Англии от Sports.ru для iOS - это вся информация об Английской футбольной Премьер-Лиге сегодня! 

Приложение Футбол Англии включает: 

• Все свежие новости о клубах чемпионата Англии из более чем 700 источников; 
• Освещение всех игр и событий сезона; 
• Полная информация о трансферах; 
• Полная статистика всех матчей чемпионата в режиме реального времени, а также статистика игроков; 
• Текстовые онлайн трансляции всех матчей, календарь чемпионата Англии и турнирная таблица; 
• Интервью, репортажи и мнения экспертов; 
• Галереи с яркими и актуальными фото; 
• Блоги и материалы пользователей об АПЛ; 
• Широкие возможности для общения с другими 
болельщиками команды.

Do you want to know how fast does your car accelerate to 100 km/h?
It’s not a secret, that data of producer is approximate and apply only for ideal conditions. To know the current speed here and now, to make a measure 0-100 km/h, 100-200 km/h, time for ¼ miles ( time of passing 402 meters) will help you the application Test-Drive.
You don’t need any additional devices as RaceLogic, because you already have the accelerometer sensor and GPS sensor in your smartphone. Due to these super sensitive sensors of your iPhone and unique algorithm, we have got am opportunity to measure the time of acceleration of the car to the necessary speed with a high accuracy.
Opportunities of the application:
          - acceleration to 100 km/h;
          - acceleration from 100 to 200 km/h;
          - acceleration to 80 km/h;
          - acceleration from 80 to 120 km/h;
          - time of passing 402 meters and 1000 meters;
          - understandable interface;
          - constant updates and expansion of the functional;
          - the results of the measures save automatically and you can share them with your friends!

ФК Ливерпуль от Sports.ru для iOS – новое приложение о футбольном клубе Liverpool, выступающем Английской Премьер-Лиге (АПЛ), позволяет любителям футбола всегда быть в курсе происходящего в любимой команде. 

Приложение о Ливерпуле включает: 

• Новости, анонсы, тексты лучших спортивных журналистов и интервью о Ливерпуле; 
• Онлайн трансляции матчей и состав команды; 
• Командную статистику во всех турнирах в режиме реального времени; 
• Календари всех турниров и турнирные таблицы; 
• Блоги и материалы пользователей о Liverpool; 
• Фото и видео; 
• Форумы и чаты для общения с другими болельщиками. 
• Освещение всего сезона, включая английский футбол - АПЛ, Кубок Англии и Кубок Лиги, а также еврокубки – Лигу Чемпионов (ЛЧ) и Лигу Европы (ЛЕ).
